function NavBar() {
  return (
    <div class="nav-bar">
      <header>
        <nav>
          <div display="block">
            <img src={logo} className="App-logo" alt="logo" width="40px" />
          </div>
          <ul display="block">
            <li>Home</li>
            <li>About</li>
            <li>Catalog</li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

// React component
function HomeView() {
  return (
    <div>
      {/* <img src="../public/logo512.png" width="40px" alt="site-logo" /> */}
      <h1>My reactive site!</h1>
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">News</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
      </ul>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <NavBar />
    <HomeView />
  </React.StrictMode>
);
